import React, { Component } from 'react'
import Widecard from '../components/Widecard';

class Experience extends Component {
    render() {
        return(
            <div className="condiv">
                <h1 className="subtopic">Experience</h1>
                <Widecard title="Sales Support Supervisor" where="Thai Lion Mentari Company" from="2019 Jun" to="Present" />
                <Widecard title="Senior Support Supervisor" where="Thai Lion Mentari Company" from="2017 Oct" to="2019 Jun" />
                <Widecard title="Passenger Service Senior" where="Thai Lion Mentari Company" from="2014 Mar" to="2017 Sep" />
                <Widecard title="Customer service" where="Thai Airway Airline" from="2014 Mar" to="2017 Sep" />
            </div>
        );
    }
}

export default Experience;
